package main

import (
	"reflect"
	"testing"
)

func TestRemoval1(t *testing.T) {

	s := "deeedbbcccbdaa"
	k := 3

	expectedOutput := "aa"
	if !reflect.DeepEqual(expectedOutput, removeDuplicates(s, k)) {
		t.Fatalf("TestRemoval failing")
	}
}

